import ItemCount from '../../components/ItemCount/ItemCount'


const ItemListContainer = ({greeting}) => {

  const getProducts = new Promise ((resove, reject) => {
   setTimeout(() => {})
    resolve([
      'producto 1',
      'producto 2',
      'producto 3',
      'producto 4',
      'producto 5',
      'producto 6',
      'producto 7',
    ])
  }) 
  
  return (
    <div>
      {greeting}
      <ItemCount />
    </div>
  )
}

export default ItemListContainer
